import React from 'react';
import PropTypes from 'prop-types';

const ArticleText = ({ body }) => (
  <div>
    <p>{body}</p>
  </div>
);


ArticleText.defaultProps = {
  body: ""
}

ArticleText.propTypes = {
  body: PropTypes.string
};

export default ArticleText;
